import React from 'react';
import styled from 'styled-components';

const Div=styled.div`
  width:236px;
  border:solid 1px #dbdbdb;
  margin: 10px;
`
const Button=styled.div`
  font-size:16px;
  color:#262626;
  padding:16px 16px 16px 30px;
  width:100%;
  height:52px;
`
function Menu() {
  return (
    <Div>
      <Button>프로필 편집</Button>
      <Button>비밀번호 변경</Button>
      <Button>앱 및 웹사이트</Button>
      <Button>이메일 및 SMS</Button>
      <Button>푸시 알림</Button>
      <Button>연락처 관리</Button>
      <Button>개인정보 및 보안</Button>
      <Button>Instagram에서 보낸 이메일</Button>
      <Button>도움말</Button>
    </Div>
  );
}

export default Menu;
